import React from 'react'
import ContactDropDown from './contactDropDown'
import './topBar.css'


export default function TopBar(props)
{
    return(
        <div className="navbar has-shadow is-fixed-top">

            <div className="navbar-brand">
                <img alt="logo" src={props.logoUrl} id="logo" className="navbar-item"/>
            </div>

            <div className="navbar-start">
                <h1 className="navbar-item" id="title">{props.name}</h1>
            </div>

            <div className="navbar-end">
            <div className="columns navbar-item">

                {
                    Object.keys(props.social).map(site => {
                      return(
                        <div className="column">
                            <a href={props.social[site]} className="navbar-item">{site}</a>
                        </div>  
                      )
                    })
                }
            </div>
            </div>
        </div>
    )
}
